import React from 'react';
import { Test } from './Test';
import { Header } from '../Base/Header';
// import { Navbar } from "../../Base/Navbar"
import { Nb } from "../Base/Nb";

class App extends React.Component {

  constructor(props) {
    super(props);
  }

  render() {
    return(
      <div className="App">
      <h1 className='text-3xl font-bold'>
        <Header />
        <Test />
        <Nb />
      </h1>
    </div>
    );
  }
}

export default App;
